<!doctype html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport"
          content="width=device-width, user-scalable=no, initial-scale=1.0, maximum-scale=1.0, minimum-scale=1.0">
    <meta http-equiv="X-UA-Compatible" content="ie=edge">
    <title>New-Year-PB 5</title>
    <link rel="preconnect" href="https://fonts.googleapis.com">
    <link rel="preconnect" href="https://fonts.gstatic.com" crossorigin>
    <link href="https://fonts.googleapis.com/css2?family=Playfair+Display:wght@900&display=swap" rel="stylesheet">
    <style>
        * {
            padding: 0;
            margin: 0;
            -webkit-box-sizing: border-box;
            -moz-box-sizing: border-box;
            box-sizing: border-box;
        }
        body {
            height: 100vh;
            overflow: hidden;
            background-color: #22211F;
            font-family: 'Playfair Display', serif;
            font-style: normal;
            font-weight: normal;
            color: #FEF8F8;
        }
        main {
            max-width: 365px;
            margin: 0 auto;
            height: -webkit-fill-available;
            padding: 6px 0 6px;
        }
        .logo {
            margin: 0 auto 12px;
            width: 210px;
            height: 54px;
        }
        .logo img {
            width: 100%;
            height: 100%;
        }
        .text-limited {
            margin: 8px auto 18px;
            text-align: center;
            font-weight: 900;
            font-size: 30px;
            line-height: 40px;
        }
        .player {
            margin: 0 auto 28px;
        }
        .player img {
            width: 100%;
            height: 100%;
        }
        .btn {
            display: flex;
            justify-content: center;
            align-items: center;
            margin: 0 auto;
            width: 366px;
            min-height: 74px;

            background: #FC0606;
            border-radius: 10px;

            font-weight: 900;
            font-size: 36px;
            line-height: 48px;
            color: #FFFFFF;

            text-decoration: none;
            text-align: center;
        }

        /*media -----------------------------*/

        @media (min-height: 750px) {
            main {
                display: flex;
                flex-direction: column;
                justify-content: center;
                padding-top: 0;
            }
        }

        @media (max-width: 410px) {
            main {
                max-width: 90%;
            }
        }

        @media (max-width: 410px) and (orientation: portrait) {
            .btn {
                width: 100%;
            }
        }

        @media (max-width: 410px) and (max-height: 667px) and (orientation: portrait) {
            .player {
                width: 265px;
                height: 379px;
            }
        }

        @media (max-width: 410px) and (max-height: 568px) and (orientation: portrait) {
            .player {
                width: 220px;
                height: 308px;
            }
        }

        @media (max-width: 410px) and (max-height: 480px) and (orientation: portrait) {
            .player {
                width: 190px;
                height: 267px;
            }
            .btn {
                font-size: 34px;
            }
        }

        @media (max-width: 280px) and (orientation: portrait) {
            main {
                display: flex;
                flex-direction: column;
                justify-content: center;
                padding-top: 0;
            }
            .player {
                width: 220px;
                height: 308px;
            }
        }

        @media (max-height: 768px) and (orientation: landscape) {
            main {
                display: flex;
                flex-direction: column;
                justify-content: center;
                padding-top: 0;
            }
            .btn {
                margin: 10px auto 10px;
            }
        }

        @media (max-height: 600px) and (orientation: landscape) {
            .player {
                width: 220px;
                height: 308px;
            }
        }

        @media (max-height: 414px) and (orientation: landscape) {
            .player {
                display: none;
            }
        }

        /*--------------*/

        @media (min-width: 412px) and (max-height: 720px) and (orientation: portrait)  {
            .player {
                width: 90%;
            }
        }

        @media (min-width: 412px) and (max-height: 665px) and (orientation: portrait)  {
            .player {
                width: 80%;
            }
        }

        @media (min-width: 412px) and (max-height: 605px) and (orientation: portrait)  {
            .player {
                width: 70%;
            }
        }

        @media (min-width: 412px) and (max-height: 560px) and (orientation: portrait)  {
            .player {
                width: 60%;
            }
        }

        @media (min-width: 412px) and (max-height: 560px) and (orientation: portrait)  {
            .player {
                width: 45%;
            }
        }

    </style>
</head>
